import{_ as e,o as t,a as o,X as r}from"./chunks/framework.BPPv2K3c.js";const m=JSON.parse('{"title":"2025年09-10月振り返り","description":"","frontmatter":{"layout":"post","title":"2025年09-10月振り返り","category":"diary","tags":["diary"],"head":[["link",{"rel":"canonical","href":"https://www.codingfeline.com/2025/10/31/09to10-wrapup/"}],["meta",{"property":"og:url","content":"https://www.codingfeline.com/2025/10/31/09to10-wrapup/"}],["meta",{"property":"og:title","content":"2025年09-10月振り返り"}],["meta",{"property":"twitter:card","content":"summary_large_image"}],["meta",{"property":"twitter:site","content":"@_yshrsmz"}],["meta",{"property":"twitter:creator","content":"@_yshrsmz"}],["meta",{"property":"og:image","content":"https://www.codingfeline.com/2025/10/31/09to10-wrapup/ogp.png"}]]},"headers":[],"relativePath":"2025/10/31/09to10-wrapup/index.md","filePath":"posts/2025/2025-10-31-09to10-wrapup.md","date":{"time":"2025-10-31","string":"October 31, 2025","year":"2025","month":"10","day":"31"}}'),i={name:"2025/10/31/09to10-wrapup/index.md"};function l(n,a,s,c,p,h){return t(),o("div",null,[...a[0]||(a[0]=[r('<p>2025の9月-10月を振り返るよ。<br> できれば続けていきたい</p><p><strong>目次</strong></p><nav class="table-of-contents"><ul><li><a href="#仕事">仕事</a><ul><li><a href="#引き続きひたすら基盤を作る感じ">引き続きひたすら基盤を作る感じ</a></li><li><a href="#気がついたら-ai-エージェントまわりも">気がついたら AI エージェントまわりも</a></li></ul></li><li><a href="#個人プロジェクト">個人プロジェクト</a><ul><li><a href="#sincetimer-の">SinceTimer の</a></li></ul></li><li><a href="#買った">買った</a><ul><li><a href="#keyboardio-preonic">Keyboardio Preonic</a></li><li><a href="#cornix">Cornix</a></li></ul></li><li><a href="#観た">観た</a><ul><li><a href="#spy-family-the-musical">SPY-FAMILY the musical</a></li></ul></li><li><a href="#ゲーム">ゲーム</a><ul><li><a href="#silksong">Silksong</a></li><li><a href="#ポケモンza">ポケモンZA</a></li></ul></li></ul></nav><h2 id="仕事" tabindex="-1">仕事 <a class="header-anchor" href="#仕事" aria-label="Permalink to &quot;仕事&quot;">​</a></h2><h3 id="引き続きひたすら基盤を作る感じ" tabindex="-1">引き続きひたすら基盤を作る感じ <a class="header-anchor" href="#引き続きひたすら基盤を作る感じ" aria-label="Permalink to &quot;引き続きひたすら基盤を作る感じ&quot;">​</a></h3><p>ひたすらドキュメントフェーズはちょっと終わりが見えてきて、開発基盤を整える感じのフェーズに入ってきた。とはいえまだ基盤の基盤を作ってるみたいな感じなのではよアプリの開発に入りたいなあという感じ。</p><h3 id="気がついたら-ai-エージェントまわりも" tabindex="-1">気がついたら AI エージェントまわりも <a class="header-anchor" href="#気がついたら-ai-エージェントまわりも" aria-label="Permalink to &quot;気がついたら AI エージェントまわりも&quot;">​</a></h3><p>Microsoft の AI エージェント周りのプロダクトを色々触ってみてるけど、まあ似たようなプロダクトが沢山あって分かりづらいですね。しかもバックエンド同じで訴求の仕方を変えました、みたいなプロダクトもあるので本当によくわからない。</p><h2 id="個人プロジェクト" tabindex="-1">個人プロジェクト <a class="header-anchor" href="#個人プロジェクト" aria-label="Permalink to &quot;個人プロジェクト&quot;">​</a></h2><p>引き続き Claude Code に色々やらせてみてる。最近は Codex CLI を MCP としても使うことができるようになったので、Claude Code をメインで使いつつ要所要所で Codex にレビュー依頼させる感じで安定してる。コーディングエージェント同士でもレビューさせると精度上がるので大事です。Claude Code は仕事は早いんだけど結構指示した内容忘れたりするので、時間はかかるものの堅実に指示を守ってくれる Codex でのレビューがかなりワークしてる印象がある。</p><h3 id="sincetimer-の" tabindex="-1">SinceTimer の <a class="header-anchor" href="#sincetimer-の" aria-label="Permalink to &quot;SinceTimer の&quot;">​</a></h3><h4 id="mvi-アーキテクチャを改修" tabindex="-1">MVI アーキテクチャを改修 <a class="header-anchor" href="#mvi-アーキテクチャを改修" aria-label="Permalink to &quot;MVI アーキテクチャを改修&quot;">​</a></h4><p>今まで Effect という名前でいわゆる one-shot event を State と別管理していたんだけど、 Jetpack Compose 移行を見越して State への統合を行った。</p><p>先月やった Omnitweety の Jetpack Compose 移行ではシンプルな State に nullable のイベントフィールド置く感じでやって、今回はなんとなくイベントの種類ごとに list で管理する方式にしてみた。大して変わらないんだけど、イベントの多い画面ではイベントの種別ごとに排他制御できるしよさそうな雰囲気。一旦 MVI のママで改修したけど、将来的には MVVM に置き換えてもいいかなあ、と思っている。何度か言ってるようにたまにメンテする系のアプリだと、現状の &quot;再利用可能な MVI&quot; は若干学習コストが高い。</p><p>まあ一旦最低限の準備はできたので次は Jetpack Compose の改修。</p><h4 id="jetpack-compose-移行中" tabindex="-1">Jetpack Compose 移行中 <a class="header-anchor" href="#jetpack-compose-移行中" aria-label="Permalink to &quot;Jetpack Compose 移行中&quot;">​</a></h4><p>これも Claude Code x Codex CLI で設計からやらせてみてる。<a href="https://github.com/Pimzino/spec-workflow-mcp/" target="_blank" rel="noreferrer">Pimzino/spec-workflow-mcp</a> という、仕様書駆動開発を実践する MCP ツールを試してみている。spec-workflow-mcp はタスクの進捗状況がわかる GUI を提供している点が大変よい。しかし Jetpack Compose 移行、みたいな大きめの機能開発で始めてしまうと、進捗管理のために作成する tasks.md が Claude Code の読み込めるトークン数を超えてくるので粒度には注意が必要（それはそう）。しかしまあ移行自体は結構順調に進んでいる気はする。ある程度アーキテクチャ整えてあるリポジトリだからかもだけど。</p><h2 id="買った" tabindex="-1">買った <a class="header-anchor" href="#買った" aria-label="Permalink to &quot;買った&quot;">​</a></h2><h3 id="keyboardio-preonic" tabindex="-1">Keyboardio Preonic <a class="header-anchor" href="#keyboardio-preonic" aria-label="Permalink to &quot;Keyboardio Preonic&quot;">​</a></h3><blockquote class="twitter-tweet"><p lang="ja" dir="ltr">ちょうど猫の下にマグネット着脱式の USB ケーブルがあって、キーボードと PC の接続が切れてるので何もできない <a href="https://t.co/cqPrUHRn0X">pic.twitter.com/cqPrUHRn0X</a></p>— せーい(CodingFeline) (@_yshrsmz) <a href="https://twitter.com/_yshrsmz/status/1968177789800157614?ref_src=twsrc%5Etfw">September 17, 2025</a></blockquote><p>買ったというよりは去年 Kickstarter で投資したものがようやく届いた、という感じ。やはり Preonic くらいのサイズがなんも考えることなくて楽ではある。しかし 40% キーボードも記号の配置を覚えられれば手を動かす範囲が小さくて別の意味で楽。</p><p>Kaleidoscope/Chrysalis は初めて使うファームウェア/設定ツールで最初ちょい戸惑ったものの必要な機能は一通り揃っているので問題はない。VIA や Vial とはまた思想の違う設定ツールで面白い。レイヤーをまたいで「こｎキーに何が割当てられているか」を確認できるのは前述の２つにはない機能だし。</p><h3 id="cornix" tabindex="-1">Cornix <a class="header-anchor" href="#cornix" aria-label="Permalink to &quot;Cornix&quot;">​</a></h3><blockquote class="twitter-tweet"><p lang="ja" dir="ltr">猫に机の大部分奪われた <a href="https://t.co/xHwr1dLdpc">pic.twitter.com/xHwr1dLdpc</a></p>— せーい(CodingFeline) (@_yshrsmz) <a href="https://twitter.com/_yshrsmz/status/1977945738845032719?ref_src=twsrc%5Etfw">October 14, 2025</a></blockquote><p>Corne をベースにした、Bluetooth 対応の左右分割 40% キーボード。レイアウトの見た目的には Cornelius が一番近い。遊舎工房のグループバイで購入したものがようやく届いた。無線の左右分割キーボードは Kinesis Advantage 360 以来だ。</p><p>結論48キーでも十分に使える。 使った感じだと、カーソルキーをデフォルトレイヤーに置こうとしなければ、44キーでもいけそう。なんなら現状左側のサムクラスタで1キー持て余してる。色々やりようはあるが、あんまり QWERTY から離れた配列にするとカスタムキーマップの使えない環境で大変になるから悩ましい。</p><p>Mod-Tap 周りの設定がまだ充実していないので、たとえば flow-tap の対象キーに <code>LT</code> とか設定すると、たまにロングタップ認定されずにうまく入力されなかったり、ある程度の不便はある。とりあえずはスペースキーに <code>LT</code> 使うのやめたらちょっと改善した気はする。</p><p>あとは Kinesis Advantage 360 でも感じたけど、やっぱり左右間も無線だとたまに左右間の通信でラグる事があるのは困りどころ。たまにしかないし電源一旦切れば直るからちょいストレス、くらいの感じ。</p><p>昔 Atreus 試したときはキー少なすぎて無理だったんだけど、40%使いこなせてる今ならまた違うかも。再チャレンジしてみようかなあ（そしてキーボードがどんどん増えていく…</p><h2 id="観た" tabindex="-1">観た <a class="header-anchor" href="#観た" aria-label="Permalink to &quot;観た&quot;">​</a></h2><h3 id="spy-family-the-musical" tabindex="-1">SPY-FAMILY the musical <a class="header-anchor" href="#spy-family-the-musical" aria-label="Permalink to &quot;SPY-FAMILY the musical&quot;">​</a></h3><p>元々 BD で観てて結構好きだったのが再演するということで行ってきた。やはり劇場で見ると迫力が違うね。</p><h2 id="ゲーム" tabindex="-1">ゲーム <a class="header-anchor" href="#ゲーム" aria-label="Permalink to &quot;ゲーム&quot;">​</a></h2><h3 id="silksong" tabindex="-1">Silksong <a class="header-anchor" href="#silksong" aria-label="Permalink to &quot;Silksong&quot;">​</a></h3><p>もともと HollowKnight の DLC として開発してた、みたいな話もあるくらいなので、難易度はやっぱり高い。というかまじで人間嫌いすぎない？　ってくらい嫌らしいステージが沢山あって第二章の中盤で放置中。面白くないとは思わないけど、でも別に私はイライラしたくてゲームをやっているわけではないので、やる気をくじくようなステージを延々とリトライさせられるのは萎えてしまう。</p><h3 id="ポケモンza" tabindex="-1">ポケモンZA <a class="header-anchor" href="#ポケモンza" aria-label="Permalink to &quot;ポケモンZA&quot;">​</a></h3><p>なんかポケモンにリアルタイム性そんなに求めてなかったな、というのがわかった一作だった。あと登場人物の行動原理に共感できないことが多すぎる…。</p>',37)])])}const u=e(i,[["render",l]]);export{m as __pageData,u as default};
